import React from 'react';
import { View, Text } from 'react-native';

const Message = ({ route }) => {
  const { ten } = route.params;

  return (
    <View>
      {/* Cấu trúc màn hình tin nhắn với header title là tên người được click */}
      <Text>{`Tin nhắn của ${ten}`}</Text>
      {/* ... (các thành phần khác của màn hình tin nhắn) */}
    </View>
  );
};

export default Message;
